import React from "react";
import "./HeaderProduct.css";

interface Props {
  link: string;
}
const HeaderProductItem: React.FC<Props> = ({ link }) => {
  return (
    <div className="header-product-item">
      <div className="header-product-image">
        <img src={link} alt="Error" />
      </div>
      <div className="text-product"></div>
    </div>
  );
};

export default HeaderProductItem;
